import React, { Component } from "react"
import { SubTitle, Title } from "./styles/footer"

class Titles extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  render() {
    return (
      <>
        <SubTitle>KEEP IN TOUCH</SubTitle>
        <Title>SUBSCRIBE OUR NEWSLETTER</Title>
      </>
    )
  }
}

export default Titles
